import React from 'react';
import bivakzones from '../bivakzones.json';


export default function WcList() {


    console.log(bivakzones)


    const bibi = [1, 2, 3, 5];

    const listBivakzones = bibi.map((bibi) =>
        <li>{bibi}</li>
    )


    return (
        <div>
            <ul key={this.name}>{listBivakzones}</ul>
        </div>
    )

}
